import React from 'react';

// SVG Representation of the Mazad Plus Logo
// Blue Square background #2563EB
// Top Text: "بلس" in White
// Bottom Text: "مزاد" in Yellow #FCD34D
const LOGO_BASE64 = "data:image/png;base64,";

interface LogoProps {
  className?: string;
}

export const Logo: React.FC<LogoProps> = ({ className }) => {
  return (
    <img 
      src={LOGO_BASE64} 
      alt="Mazad Plus Logo" 
      className={`object-contain shadow-sm ${className}`}
    />
  );
};